class Solution(object):
    def findLatestStep(self, arr, m):
        
        l = [0, len(arr)+1]
        
        for i in range(len(arr)-1, -1, -1):
            num = arr[i]
            # print num
            pos = bisect.bisect(l, num)
            l.insert(pos, num)
            if pos>0 and l[pos]-l[pos-1]-1==m:
                return i
            if pos+1<len(l) and l[pos+1]-l[pos]-1==m:
                return i
        
        return -1

